import { render } from '@testing-library/react';
import React from 'react';

const WidgetList = ({widgets=[], 
    createWidget, 
    deleteWidget, 
    updateWidget}) => 
        <div>
            <h1>Widgets!!!!</h1>
            <ul>
                {
                    widgets.map(widget =>
                        <li>
                            <button onClick={deleteWidget} className="btn btn-sm btn-primary">
                                Delete
                            </button>
                            {widget.name}
                        </li>
                    )
                }
            </ul>
        </div>


export default WidgetList;
